import React, {Component} from 'react';
import { makeStyles } from '@material-ui/styles';
import { Grid, Hidden, Container, Card } from '@material-ui/core';
import windowSize from 'react-window-size';
import {
  Budget,
  TotalUsers,
  TasksProgress,
  TotalProfit,
  LatestSales,
  UsersByDevice,
  LatestProducts,
  LatestOrders,
  Filter,
  PropertyList,
  MapContainer,
  PropertyHeader,
  Amenities,
  FloorPlans
} from './components';
import './Property.css';

makeStyles(theme => ({
  root: {
    padding: theme.spacing(0), maxWidth: 800, 
  }
}));

const isDesktop = 0;
class Property extends Component {
  render(){
    console.log('props: ', this.props)
    if(isDesktop == 0){
      return (
        <div Container>
          <PropertyHeader></PropertyHeader>
          <div style={{display:'flex', justifyContent:'center'}}>
            <div style={{maxWidth:850}}>
              <Grid style={{padding:30}} container >
                  <Grid item lg={12}>
                    <Amenities style={{marginBottom:30, position:"sticky", position: '-webkit-sticky', top: 0}}></Amenities>
                    <FloorPlans/>
                  </Grid>
              </Grid>
            </div>
            <div className="StickyC" style={{padding:30, position:'sticky', height:400, top:100}}>
              <Amenities style={{width:350}}></Amenities>
            </div>

          </div>


        </div>

      );
    } else {
        return(
            <div></div>
        );
    }
  };
  }

export default windowSize(Property);
